function multiplyAll(arr) {
  var product = 1;
  // Only change code below this line
  for (var z=0;z<arr.length;z++){
    for (var x=0;x<arr[z].length;x++)
      product *= arr[z][x];
  }
  // Only change code above this line
  return product;
}

